import React from "react";
import ReactTable from "react-table";
import "react-table/react-table.css";

const data: any = [
  {
    displayDate: "5/14",
    rsvped: 5,
    attended: 2
  }
];

const columns = [
  {
    Header: "Date",
    accessor: "displayDate"
  },
  {
    Header: "RSVPs",
    accessor: "rsvped"
  },
  {
    Header: "Attended",
    accessor: "attended"
  }
];

const AttendanceBySignupDateTable = () => {
  return <ReactTable data={data} columns={columns} />;
};

export default AttendanceBySignupDateTable;
